import React, { useReducer } from "react";

const initialValue = {
  hour: "00",
  minute: "00",
  second: "00",
};

function App() {
  return (
    <div>
      <h1>Stopwatch</h1>
      <div className="timer">
        <div className="hour">Hour</div>
        <div className="button">
          <button>Stop</button>
          <button>Start</button>
          <button>Restart</button>
        </div>
      </div>
    </div>
  );
}

export default App;
